import {useRouter} from "next/router";
import React from "react";
import HeaderBar from "../../components/nav/HeaderBar";
//import { Typography } from "@material-ui/core/Typography";
import MakeVideoPlayer from "../../components/Posts/MakeVideoPlayer";
import GetVideos from "../../components/Videos/GetVideos";
import GetTrueVideoSource from "../../components/Posts/GetTrueVideoSource";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";

export async function getServerSideProps(context){
    let page = context.query.page;
    let videoArray = await GetVideos(page);
    const videos = await Promise.all(videoArray.map( async (videoPost)=>{
        const video = videoPost.node.url;
        const trueVideo = await GetTrueVideoSource(video);
        return await trueVideo
    }));
    console.log(videos);
    return{props: {videos}}
}

const Page = ({videos}) => {
    const router = useRouter();


    const videoList = videos.map((url)=>{
        return (
        <Card key={url}>
            {media}
            <CardActions>
                <Button size="small" color="primary">
                    Share
                </Button>
                <Button size="small" color="primary">
                    Likes
                </Button>
            </CardActions>
        </Card>
        )
    });

    return (
        <div>
            <HeaderBar/>
            <div>
                <div className='pagetitle'>
                    <p align='center' variant={'h4'}>{router.query.page}'s Videos</p>
                </div>
                <ul>
                    {videoList}
                </ul>
            </div>
        </div>
    );
};

export default Page;
